import CartWidget from "./CartWidget.jsx";
import "./NavBar.css"

const NavBar = () => {
    return (
        <header>
            <nav>
                <section>
                    <span>Polimery</span><span>Wolf</span>
                    <a href="#">Nosotros</a>
                    <a href="#">Contactos</a>
                    <a href="#">Store</a>
                </section>
                <section>
                    <CartWidget/>
                </section>
            </nav>
        </header>
    );
}

export default NavBar;
